using namespace std;

int main()
{
    ifstream fin("produsmaxim.in");
    ofstream fout("produsmaxim.out");
    int n;
    while (fin >> n) {
         int a, b, c; // a = b = c => 100% produsul maxim
        a = b = c = n/3; // le am pus pe toate = n / 3, 7 /3, adica 2
        b = (n - a) / 2;
        c = n - b - a;
        fout << n <<" " << a << " "<< b << " " << c << "\n"; // aparent \n e mai rapid decat << endl....

    }


    fin.close();
    fout.close();
    return 0;
}

#include <iostream>
#include <fstream>

using namespace std;

int main()
{
    ifstream fin("produsmaxim.in");
    ofstream fout("produsmaxim.out");
    int n;
    while (fin >> n) {
        // cu cat numerele sunt egale sau aproape egale avem produs maxinm
        int a, b, c; // a = b = c => 100% produsul maxim
        a = b = c = n/3; // le am pus pe toate = n / 3, 7 /3, adica 2
        // odata ce am aflat a, e clar ca b + c = (n-a)
        // deci inseamna ca b = (n-a) / 2;
        b = (n - a) / 2;
        // odata ce avem si a si b=> c = n-b-a; 
        // tododata respectam si conditia a<=b<=c
        c = n - b - a;
        fout << n <<" " << a << " "<< b << " " << c << endl;

    }


    fin.close();
    fout.close();
    return 0;
}

