int main()
{
    int n;
    cin >> n;
    int palMax, aparitii = -1;
    while(n != 0) {
        if (estePalindrom(n)){
            if (aparitii == -1) {
                aparitii = 1;
                palMax = n;
            } else if (n == palMax) {
                aparitii++;
            } else if (n > palMax) {
                palMax = n;
                aparitii = 1;
            }
        }
        cin >> n;
    }

    if (aparitii == -1) {
        cout << "NU EXISTA";
    } else {
        cout << palMax << " " << aparitii;
    }

    return 0;
}


int estePalindrom(int x) {
    if (oglindit(x) == x) {
        return 1;
    } else {
        return 0;
    }
}

int oglindit(int n) {
    int rezultat = 0;
    while(n > 0) {
        int ultimaCifra = n % 10;
        rezultat = rezultat * 10 + ultimaCifra;
        n = n/10;
    }

    return rezultat;
}

