//Date: 25.11.2023
//Program: 0-9999 1 sec up counter
//Author: LKCX (shuspano@mail_removeme.ru)
//Compiler: AVR-GCC
//MCU: ATTiny26L
//Display: 7-seg 8-digit MAX7219 chinese module 

#define F_CPU	4000000UL
#define DIN	PA5
#define CS	PA6
#define	CLK	PA7

#include <avr/io.h>
#include <util/delay.h>

void Setup()	{
	DDRA |= (1 << DIN)|(1 << CS)|(1 << CLK);
	PORTA |= (1 << CS);	//must be high in initial state
}

void ShiftOut(uint8_t temp)	{
	uint8_t i;
	for (i = 0; i < 8; i++)	{
		if (temp & 0x80)
		{
			PORTA |=  (1 << DIN);
		}
		else
		{
			PORTA &= ~(1 << DIN);
		}
		PORTA |= (1 << CLK);
		temp = temp << 1;
		_delay_us(4);
		PORTA &= ~(1 << CLK);
		_delay_us(2);
	}
}

void MaxWrite(uint8_t max_reg, uint8_t max_data)	{
	PORTA &= ~(1 << CS);
	ShiftOut(max_reg);
	ShiftOut(max_data);
	PORTA |= (1 << CS);
	_delay_us(1);
}

void main()	{
	Setup();
	MaxWrite(0x0C, 0x01);	//display enable
	MaxWrite(0x0B, 0x03);	//scan limit: 4 digits on
	MaxWrite(0x0A, 0x00);	//brightness control: moderate
	MaxWrite(0x09, 0x0F);	//BCD decode mode: 3-0 digits

	uint8_t num0 = 0x00;
	uint8_t num1 = 0x00;
	uint8_t num2 = 0x00;
	uint8_t num3 = 0x00;
	
	while(1)	{
		MaxWrite(0x01, num0);
		MaxWrite(0x02, num1);
		MaxWrite(0x03, num2);
		MaxWrite(0x04, num3);
		_delay_ms(1000);
		num0++;
		if (num0 > 0x09)	{
		num0 = 0x00;
		num1++;
		}
		if (num1 > 0x09)	{
		num1 = 0x00;
		num2++;
		}
		if (num2 > 0x09)	{
		num2 = 0x00;
		num3++;
		}
		if (num3 > 0x09)	{
		num3 = 0x00;
		}
	}
}

