	string text = "Hello"; //инициализация строки

	//string text( "Hello" ); // другой вариант инициализации

	cout << text << endl;

	string text2(10, 'a'); // создаем строку из десяти символов 'a'
	cout << text2 << endl;

	text2 = "new string"; // изменяем значение строки
	cout << text2 << endl;

