	cout << "Введите строку: ";
	//cin >> text; //ввод строки строки из консоли (до первого пробела)
	getline(cin, text); // чтение строки с пробелами
	cout << text << endl;

	// вариант обработки (вывода) строки
	for (int i = 0; i < text.size(); i++) { // метод size возвращает размер строки
		cout << text[i] << " "; 
	}
	cout << endl;

	// другой вариант обработки (вывода) строки
	for (auto a : text) { 
		cout << a << "_";
	}
	cout << endl;

	cout << "Строка 1: " << text << endl;
	cout << "Строка 2: " << text2 << endl;
	cout << (text == text2) << endl;
