#define ll long long

void mySwap(int S[],int i,int j){
    S[i]^=S[j]^=S[i]^=S[j];
}
int main(){
    int n=10,a[10005];
    //scanf("%d",&n);
    for(int i=0;i<n;++i){
        a[i]=rand()%1000+1;
        printf("%d ",a[i]);
    }
    printf("\n");
    for(int i=0;i<n-1;++i){
        bool flag=0;
        for(int j=0;j<n-i-1;++j){
            if(a[j]>=a[j+1]){
                mySwap(a,j,j+1);
                flag=1;
            }
        }
        if(!flag)break;
    }
    for(int i=0;i<n;++i)
        printf("%d ",a[i]);
